import './Search.css'

function Search() {
    return(
        <section className='search'>
            <div className="search-layout">
                <h1 className='search-title'>인프런에서 성장을 도와드려요</h1>
                <br/>
                <input className='search-course' type='text'>
                </input>
            </div>
            
        </section>
    );
};

export default Search;
